import { Route, Routes, useParams } from "react-router-dom";
import "./App.css";
import BaseLayout from "./components/layout/BaseLayout";
import Topheader from "./components/Topheader";
import Porductsave from "./components/product/Productsave";
import Blog from "./components/blog/Blog";
import BlogUserProduct from "./components/blog/BlogUserProduct";

function App() {
  const { product_code } = useParams();
  return (
    <div className="container">
      <Topheader />
      <Routes>
        <Route path="/" element={<BaseLayout />}></Route>
        <Route path="/product/save" element={<Porductsave />} />
        <Route path="/blog" element={<Blog />} />
        <Route
          path="/blog/user/product/:product_code"
          element={<BlogUserProduct />}
        />
      </Routes>
    </div>
  );
}

export default App;
